import React from 'react';

const InformationPage = () => {
  return (
    <div>
      <div style={topPortionStyles}>
        <div style={ellipseBoxStyles}>Box 1</div>
        <Arrow />
        <div style={ellipseBoxStyles}>Box 2</div>
        <Arrow />
        <div style={ellipseBoxStyles}>Box 3</div>
        <Arrow />
        <div style={ellipseBoxStyles}>Box 4</div>
      </div>

      <div style={formStyles}>
        <form>
          {/* Your form elements go here */}
          <label>
            Name:
            <input type="text" name="name" />
          </label>
          {/* Add more form elements as needed */}
          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
};

// Styles for the top portion (containing elliptical boxes and arrows)
const topPortionStyles = {
  display: 'flex',
  justifyContent: 'space-around',
  alignItems: 'center',
  padding: '20px',
  position: 'relative',
};

// Styles for individual elliptical boxes
const ellipseBoxStyles = {
  width: '100px',
  height: '50px',
  borderRadius: '50%',
  background: '#3498db', // Change the background color as needed
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  color: '#fff', // Change the text color as needed
  position: 'relative',
};

// Styles for the form section
const formStyles = {
  padding: '20px',
};

// CSS class for the arrow
const arrowStyles = {
  position: 'absolute',
  height: '2px',
  width: '50px',
  background: '#3498db', // Change the arrow color as needed
};

// Arrow component
const Arrow = () => (
  <div style={arrowStyles}>
    <div style={arrowTipStyles}></div>
  </div>
);

// Styles for the arrow tip
const arrowTipStyles = {
  position: 'absolute',
  top: '-5px',
  right: '-10px',
  border: 'solid transparent',
  borderWidth: '10px',
  borderTopColor: '#3498db', // Change the arrow color as needed
};

export default InformationPage;
